function cleanDiv() {
    $('#parent1').empty();
    $('#parent2').empty();
    $('#chart-parent').empty();
    $('#chart-parent').append('<div id="chartdiv"></div>')
}

function getNationsBarchart() {
    $('#nations-button-barchart').empty()
    $('#nations-button-barchart').append(`
    <div class="dropdown">
    <button class="btn btn-secondary dropdown-toggle" type="button" id="dropdownMenu2" data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
      Choose nation
    </button>
    <div id="nations" class="dropdown-menu" aria-labelledby="dropdownMenu2">
  
    </div>
  </div>`)
    $.getJSON('barchart-new-merge.json',function(jsondata){
      var nations = Object.keys(jsondata)
      console.log(nations)
      $.each(nations, function(idx, n) {
        $('#nations').append(`
        <button onclick="getChart('${n}');" class="dropdown-item" type="button">${n}</button>
        `)
      })
    })
  }


